INSERT INTO `review360_exam` VALUES ('25', '风向评测-V1', 'JrPmMfMkGdNaBsMyUtJa', null, '12', '44', '1440841046', '1441614987');
INSERT INTO `review360_exam` VALUES ('26', '风向评测-V2', 'DmVoBhCtWpRkOkVgFtOd', null, '0', '45', '1440841051', '1440841051');
INSERT INTO `review360_report_str_result` VALUES ('1', 'D', '创建者', 'D+，I,S,C-', '能量充沛，行为独特，非常追求新挑战与新机遇。他们有很强的自我力量。喜欢刺激，常常投入到不经深思的冒险中。为了达成目的，他们会给人和环境提出要求，会勾画“蓝图”并充满激情地去推进实施。你最怕被受到控制与利用，在压力下可能会显得非常直率而缺乏沟通艺术。', '直接的，果断的；他们具有强大的自我力量，通常是问题的解决者；他们是冒险家，其激励通常来之于自身。', '强烈的支配行为特征，有时候却可能显得过于武断权威；好争论，或过于盛气凌人；他们不喜欢常规，喜欢冒险却可能行动过急。', '通常关注于成就与结果，在极端的情况下，这种行为类型的个体可能仅仅把他人当作达成目标的工具或手段。“支配”不是一个表示情感的特征因素，他们通常不会过多关注人际关系与情感需求。对于他人来说，会发现很难去打破他们这种天生谨慎、怀疑的表象。', '具有领导与控制的才干，这些都是基于他们直接的、高标准要求的天性。这种行为类型的个体，比较起需要紧密关系结合的工作情境来说，更适应于结构化的、正式的工作情境。他们是非常具有竞争力与自信的人群，在信息缺乏的情势下，仍然能够迅速做出决策并实施计划。在他人看来极度困难的任务，对于他们来说却可能“如鱼得水”。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('2', 'DI', '总结者', 'D,I+,S,C-且D>I', '非常强烈的个人主义者。他们富于梦想，不断进取而且为达目的不懈努力。他们能量充沛又直接主动。总结者对自己和周围的人都有较高的标准，对他人很有影响力，能激励他人去实现目标。总结者会看上去冷酷或迟钝，因为他们是典型的任务取向者。他们很容易发脾气，尤其是感受到被超越时，因此他们总是不断向前', '非常外向开放，这种行为类型的个体热爱社交，目的明确且果断；他们勇于接受挑战，也激励他人；是非常有说服力的谈判者', '可能因为其外向的态度会显得富有攻击性，易发怒，耐不住性子；这种行为类型的个体很可能会显得尖刻、固执己见、“说到风就是雨”。', '非常强的社会交际与说服沟通的能力，这种行为类型的个体通常极具个人魅力；但是在面临压力或困难的情况下，他们倾向于采取一种更加直接、专横的做法。他们这种外向且行动快速的风格有时可能让他人受不了；尤其是当他们感觉无所畏惧的时候，他们更加倾向于毫无顾忌地表达他们的观点，而不是采取某种委婉间接的方式。', '“挑战”是对他们最好的描述。在他人可能感觉压力或困难的情境下，这种行为类型的个体却能够倍受激励。他们通常乐意为了成功与获得赞誉承担几乎任何的工作，这种风格却很难在其他行为类型中被发现。他们非常适合承担销售类型的工作，他们思考行动迅速，愿意直面挑战，并且可以利用他们的独断与说服能力去激励他人接受某个方案或产品。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('3', 'DIS', '主导者', 'D,I,S+,C-且D>I>S', '具有先见之明，而且善于社交，所以有惊人的驱动力。他们精力充沛，又善于交往，并激励他人与任务前进。主导者往往有宏观性的目标，却可能忽视细节。主导者会坚定地让他人接受自己的想法，他们可能会经常遭遇冲突，但却毫不屈服。他们需要行动自由，而且通常快速敏捷。', '非常外向开放，这种行为类型的个体热爱社交，目的明确且果断；他们勇于接受挑战，也激励他人；是非常有说服力的谈判者。', '可能因为其外向的态度会显得富有攻击性，易发怒，耐不住性子；这种行为类型的个体很可能会显得尖刻、固执己见、“说到风就是雨”。', '人际的交流沟通方面，其高“影响”与高“稳健”因子，都预示着一种开放社交的态度。他们平易近人，在一般场合下都能应付自如。他们通常独立自主，竭尽全力去维持自我的独立意识、形象与观点。', '具有非常稳健与独立的个人特征，并伴之以社会交际的能力。他们通常主动发起或主导任务或项目，这个能力通常在其他行为类型中很少见。他们极具个人责任感，其内在强烈的独立意识促使他们深具效率。他们做事的耐心与对目标的执着，确保了他们可以达成结果；与此同时，他们也能在达成最后决策前，考虑他人的建议或其他选择。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('4', 'DIC', '守法者', 'D,I,C+,S-且D>I>C', '精力充沛，善于关注他人并推动任务完成。他们生性喜欢人，但这并不意味着顺从。他们是非常社会性的个体，但也关注具体细节。守法者希望事情顺理成章，也可能会独自完成项目以确保准确。守法者可能会因缺乏深思熟虑而鲁莽行事，但是他们却很少犹豫不决。最终的结果始终激励着他们，他们希望快速实现结果。', '非常外向开放，这种行为类型的个体热爱社交，目的明确且果断；他们勇于接受挑战，也激励他人；是非常有说服力的谈判者。', '可能因为其外向的态度会显得富有攻击性，易发怒，耐不住性子；这种行为类型的个体很可能会显得尖刻、固执己见、“说到风就是雨”。', '在人际的交流沟通方面，其风格通常随情境的不同而变化。在他们所熟悉的，非正式的场合中，他们将展现出友好、平易近人的态度；通常来说开放且富有热情。如果情境相对正式或规章制度比较严格，他们将更多地显示出一种直接、坚定的态度，果断且自控，其社交友好的一面通常被隐藏。在这种情景下，他们将更多地展示出其积极主动的一面，在压力下甚至可能采取尖刻、生硬的态度。', '能力特征，同样可是基于情境变化的。他们可以根据情境的要求不同，展现出热情开放的一面，或者直接果断的一面。从管理者的角度出发，可以基于工作的要求，主动将这种行为类型的个体进行适当的环境匹配，以求获得更好的绩效表现。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('5', 'DS', '达成者', 'D,S+,I,C-且D>S', '富于客观性，而且善于分析。他们可以非常独立，但也会喜欢合作。达成者的动力来自于内在而不是外在，他们关注任务却可能过于忽视考虑他人，这使他们可能看起来缺少人情味。达成者有着坚定的信念，所以在很多事情上会成功。他们平静、沉着以及任务导向的特点使他们能够成为好的领导。', '可能是外向性格人群中最顺从的行为类型个体了；他们对于目标专心一致，有始有终；他们通常努力工作，也激发他人为了共同的目标而努力。', '通常低调，不轻易改变自己的态度或方向；相比较其他“支配”因子明显的个体来说，他们显得更加不确定，或“焦虑”。', '一方面，高“支配”性代表了制约以及怀疑，倾向于内敛保留；另一方面，高“稳健”性代表了开放的个性，表示个体喜欢维持一种融洽与互信的关系。对于这种行为类型的个体来说，他们通常将表现出冷静、沉着、客观的一面；基于情境考虑，如果他们能够感觉到轻松与自在的氛围，他们也将显示出其平易近人、友好的一面。', '显示出专注与实用的风格。这种行为类型的个体对待工作或任务有始有终，通常一心一意直到达成目标。他们尽量在合理的时间段内完成所赋予的任务，但他们仍然关注前期规划。在符合他们性格特征的情境下，他们将更多地显示出谨慎、深思熟虑的一面；而在压力的情境下，则会显示出急迫与苛求的一面。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('6', 'DC', '挑战者', 'D,C+,I,S-且D>C', '善于创造性地思考问题。因为他们善于解决问题，所以他们能够在很短时间内完成重大任务。他们有着完美的特质倾向，因此他们追求精准与精确。他们更喜欢独自工作，讨厌受到限制。挑战者是任务导向的，更看重行为结果，而不是人际关系。他们习惯于克制情绪，避免情感的影响。', '勤奋且富有能力；这种行为类型的个体是乐观与信念的结合体；他们喜欢目标与细节；具有细致思考与果断的领导特征。', '喜欢直面冲突，有时显得顽固且尖刻；这种行为类型的个体通常具有敌意的表现，其任务导向的态度不会过度考虑情感的因素。', '通常不将人际的交流沟通（至少是在人与人这个层面上）作为他们待人处事的重要因素被加以考虑。如果与人的交流沟通是非常重要的，他们倾向于简短、直接且实际。他们通常以怀疑的态度审视事与物，除非绝对必要，他们轻易不会表达自己的观点或见解。', '总是被成就与效率所激励。因为“服从”因子（C）的存在，他们又非常关注细节与精确性。比如，他们会观察并指出他人的错误或疏漏，有时候却会显得过于吹毛求疵。但是，这种“效率”与“精确”的组合，再加上一点强硬的态度，却可以在面对困难任务时，显得非常有效。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('7', 'I', '沟通者', 'I+,D,S,C-', '通常充满热情和乐观，他们通过人来实现目标。他们喜欢在人群中，因此不喜欢独自工作。他们有着显著超于常人的交流技巧。他们喜欢社会承认，害怕不被接受。沟通者精力充沛，但是在实际工作中却可能会粗心并缺乏组织性。沟通者善于鼓励，有时候却会发展为奉承。', '总是显示出其热情开朗的一面；他们信任他人，深具说服力且健谈；对待生活或工作充满乐观；他们通常也是感性的。', '可能过于关注大众或人际的关系而忽略了实际结果的重要性；他们可能不重视细节，而空喊方向；因为其活跃的性格，很可能不能仔细聆听。', '他们外向自信，因此在社交能力方面表现突出。对于他们周围的人来说，往往会被他们那种明显的自信，以及对于他人表现出的热情与互动所吸引并被打动。', '他们是优秀的说服者，完全以人际关系为导向。他们善于传递思想与观念，并影响他人；同时，他们同样也可以适应不同的情境要求，并尝试去理解他人的观点与建议。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('8', 'ID', '劝说者', 'D,I+,S,C-且I>D', '通常喜欢社交，对人特别感兴趣，能获得不同类型人的尊重与钦佩。他们以一种友好的方式工作，但却会为了目标而努力超过他人并突出自己的观点。劝说者既要权威也要威望，他们喜欢有变化性的富有挑战的工作，但是也可能因为忙碌而紧张。他们也经常被认为是自负的。', '非常典型的外向性格表现；这种行为类型的个体充满热情与活力，他们同时具有“影响”因子的人格魅力与“支配”因子的果断性。', '很可能说得多而做得少，因为说得多也很易于暴露其弱点；这种行为类型的个体在压力下，会显示出其刻薄无利的一面。', '通常极具个人魅力；但是在面临压力或困难的情况下，他们倾向于采取一种更加直接、专横的做法。他们这种外向且行动快速的风格有时可能让他人受不了；尤其是当他们感觉无所畏惧的时候，他们更加倾向于毫无顾忌地表达他们的观点，而不是采取某种委婉间接的方式。', '“挑战”是对他们最好的描述。在他人可能感觉压力或困难的情境下，这种行为类型的个体却能够倍受激励。他们通常乐意为了成功与获得赞誉承担几乎任何的工作，这种风格却很难在其他行为类型中被发现。他们非常适合承担销售类型的工作，他们思考行动迅速，愿意直面挑战，并且可以利用他们的独断与说服能力去激励他人接受某个方案或产品。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('9', 'IDS', '变革者', 'D,I,S+,C-且I>D>S', '通常善于社交，亲切友善，喜欢改变环境并成为领导者。他们能通过他们的社交技巧实现目标。变革者会对工作非常投入地去完成，同时他们对自己的局限也了如指掌，知道在必要的时候寻求帮助。变革者渴望被欢迎与被承认，容易相信他人。变革者会不停地工作、社交，喜欢起带头的作用。', '具有非常典型的外向性格表现；这种行为类型的个体充满热情与活力，他们同时具有“影响”因子的人格魅力与“支配”因子的果断性。', '很可能说得多而做得少，因为说得多也很易于暴露其弱点；这种行为类型的个体在压力下，会显示出其刻薄无利的一面。', '在人际的交流沟通方面，其高“影响”与高“稳健”因子，都预示着一种开放社交的态度。他们平易近人，在一般场合下都能应付自如。他们通常独立自主，竭尽全力去维持自我的独立意识、形象与观点。', '具有非常稳健与独立的个人特征，并伴之以社会交际的能力。他们通常主动发起或主导任务或项目，这个能力通常在其他行为类型中很少见。他们极具个人责任感，其内在强烈的独立意识促使他们深具效率。他们做事的耐心与对目标的执着，确保了他们可以达成结果；与此同时，他们也能在达成最后决策前，考虑他人的建议或其他选择。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('10', 'IDC', '领导者', 'D,I,C+,S-且I>D>C', '通常非常重视任务完成，同时也关注人际关系。他们善于将人们集合起来形成团队或组织。领导者友好和善，喜欢被人簇拥，也追求目标的良好实现。他们有着出色的沟通技巧。领导者希望结果准确，因此在压力下会倾向表现出盛气凌人和攻击型。他们可能更需要培养聆听的技能。', '具有非常典型的外向性格表现；这种行为类型的个体充满热情与活力，他们同时具有“影响”因子的人格魅力与“支配”因子的果断性。', '很可能说得多而做得少，因为说得多也很易于暴露其弱点；这种行为类型的个体在压力下，会显示出其刻薄无利的一面。', '在人际的交流沟通方面，其风格通常随情境的不同而变化。在他们所熟悉的，非正式的场合中，他们将展现出友好、平易近人的态度；通常来说开放且富有热情。如果情境相对正式或规章制度比较严格，他们将更多地显示出一种直接、坚定的态度，果断且自控，其社交友好的一面通常被隐藏。在这种情景下，他们将更多地展示出其积极主动的一面，在压力下甚至可能采取尖刻、生硬的态度。', '他们可以根据情境的要求不同，展现出热情开放的一面，或者直接果断的一面。从管理者的角度出发，可以基于工作的要求，主动将这种行为类型的个体进行适当的环境匹配，以求获得更好的绩效表现。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('11', 'IS', '建议者', 'I,S+,D,C-且I>S', '通常善于关怀，同情和理解他们身边的人。他们在大多数社会情境里总能找到平衡。他们是很好的倾听者，极富人情味的朋友。他们也是天生的团队参与者，在平和的环境里表现通常出色。建议者一般不会将自己的想法强加于人，面对冲突通常回避妥协。他们通常需要获得关注与称赞。', '通常是平易近人的；这种行为类型的个体以人际关系为导向，是团队合作的最佳人选；他们乐于助人，且善于倾听理解。', '很可能缺少“持久性”；这种行为类型的个体也可能是缺乏自我约束与纪律的；他们喜欢社交更甚于实际的工作，因此他们本身对于无效率也会采取容忍的态度。', '能够很轻易地融入社交的氛围中，他们妥帖适度的行为举止也使得他们很容易与陌生人建立起互动。他们通常深具说服力，但是，其“稳健”的行为因子也预示着如果情境需要，他们也可以采取相对被动开放的姿态，以倾听或尝试接受他人的建议。', '优势在于沟通与理解。“影响”与“稳健”因子相互平衡，以满足这种行为类型个体很好地充当“支持”的角色。同时，其外向的行为特征也意味着他们在需要互动与说服的情境下也能自如因应。需要指出的是，相比较纯粹的“稳健”行为特征来说，他们较少关注实用性，而显得少许“浮”了一点。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('12', 'ISC', '管理者', 'I,S,C+,D-且I>S>C', '通常精力充沛，具有高超的沟通技巧，善于关怀和体察他人。他们直率、友好、热情洋溢、随意而健谈。管理者希望成为团队的一员，一旦他们的权威被确认，他们就有能力成为支配性的领导者。管理者最害怕被拒绝、批评和失去安全感，所以他们可能会过多地在意他人的想法。他们非常在意自己的工作质量，期望得到赞誉。', '通常是平易近人的；这种行为类型的个体以人际关系为导向，是团队合作的最佳人选；他们乐于助人，且善于倾听理解。', '很可能缺少“持久性”；这种行为类型的个体也可能是缺乏自我约束与纪律的；他们喜欢社交更甚于实际的工作，因此他们本身对于无效率也会采取容忍的态度。', '“影响”代表着他们外向友好的态度；“稳健”代表着他们耐心并乐于倾听；而“服从”则代表着他们总是可以理性地看待问题，提出令人信服且合情合理的建议。', '充分地体现在人际沟通与关系构建的方面。这种行为类型的个体，通常能够很好地与他人合作，并关注他人意见的表达。虽然他们同样能够显示出领导者的某些特质，但是“武断”与“固执”却不是他们的显著特征。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('13', 'IC', '评估者', 'I,C+,D,S-且I>C', '通常善于观察细节，包括人的独特价值。他们会利用特定的关注去观察和鉴赏他人的工作，以促使公开交流渠道的形成。他们对所要完成的任务总是表现出极大的热爱与乐观，而且也影响了周围的人。他们对于事物的热爱总是基于对目标达成的因素评价上的，他们的鼓励直接指向任务的完成。他们喜欢评价，也关注细节。', '可能是自信的、感性的；这种行为类型的个体愿意去为他人或自己去做推广；他们富有创意，也是优秀的演说者。', '有可能是一个梦想主义者，一旦无法达成理想，反而会自我否定；有时候会被轻易激怒而显得过于尖酸刻薄。', '在人际的交流沟通方面，其行为模式通常依赖于不同的情境。在朋友的圈子内，或非正式的场合，其行为模式通常显示出自信与外向的表现；在正式的工作、商业场合，或者在压力的气氛下（例如面试、谈判），其自信外向的一面可能会被一种更加内敛谨慎的态度所取代。', '不同的情境会产生不同的行为反映，因此，对于管理者来说，如果需要有效地管理该个体或预测其绩效，需要仔细考虑其所处环境对其的影响。通常情况下，这种行为类型的个体将更多地显示出其“影响”的一面，因此，自信与善于交流的能力特征一般也较为明显。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('14', 'S', '规划者', 'S+,D,I,C-', '通常生性稳定，喜欢保持周围环境，尤其是周围人际关系的稳定性。他们喜欢帮助他人，并能与很多不同个性的人相处融洽，因为他们总是善于自我控制并谦恭有礼。他们也通常耐心，循规蹈矩。规划者需要时间来适应变化，不愿意抛弃“老一套”，他们更喜欢循序渐进的改变。一旦他们下定决心，就会坚持到底，甚至会非常顽固。', '通常是良好的倾听者，团队活动的参与者；他们稳定、可被信赖、其行动也通常可被预测；他们善解人意，总是以和谐的人际关系为主导导向。', '通常拒绝改变，尤其是突变；他们需要较长的时间来适应变化；其个性中有好嫉妒的成分，对批评与指责很敏感；在工作上也很难确立优先的位置。', '期待他人能够主动发起互动的要求，因为他们稳健依赖的特征，促使他们更善于维持一段既有的人际关系，而不是去开创新的关系。正因为如此，他们的人际关系圈子通常很小，但却是异常稳固可靠。', '他们通常可被信赖且忠诚。这种行为类型的人是天生的聆听者与咨询顾问。他们在行为上持续可靠，对待任务工作耐心稳健直到完成，也正因为如此，使得他们比较起其他行为类型的个体来说，更善于处理纷繁复杂的琐事。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('15', 'SD', '达成者', 'D,S+,I,C-且S>D', '通常是富于客观性，而且善于分析。他们可以非常独立，但也会喜欢合作。达成者的动力来自于内在而不是外在，他们关注任务却可能过于忽视考虑他人，这使他们可能看起来缺少人情味。达成者有着坚定的信念，所以在很多事情上会成功。他们平静、沉着以及任务导向的特点使他们能够成为好的领导。', '可能是最具活力的“稳健”行为类型的个体了；他们通常压力承受力良好，实事求是，但也不愿轻易冒险；他们很可能也是不错的辅导者。', '有时候会显得固执，不轻易屈服；这种行为类型的个体有可能会拒绝合作，对于自我的个人生活也通常保留。', '通常将表现出冷静、沉着、客观的一面；基于情境考虑，如果他们能够感觉到轻松与自在的氛围，他们也将显示出其平易近人、友好的一面。', '对待工作或任务有始有终，通常一心一意直到达成目标。他们尽量在合理的时间段内完成所赋予的任务，但他们仍然关注前期规划。在符合他们性格特征的情境下，他们将更多地显示出谨慎、深思熟虑的一面；而在压力的情境下，则会显示出急迫与苛求的一面。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('16', 'SDC', '探索者', 'D,S,C+,I-且S>D>C', '通常有耐性、控制力、实事求是，为达目的而坚持不懈。他们体贴而谦逊有礼，与大多数人关系良好。在必要的时候，他们也能够立场分明。他们会仔细制定工作计划，但充满进取心。探索者总是有选择性地结交朋友，他们习惯于先分析是否能够达到目标，然后才会坚定去实施。他们是目标导向的，非常值得信赖。', '可能是最具活力的“稳健”行为类型的个体了；他们通常压力承受力良好，实事求是，但也不愿轻易冒险；他们很可能也是不错的辅导者。', '有时候会显得固执，不轻易屈服；这种行为类型的个体有可能会拒绝合作，对于自我的个人生活也通常保留。', '可能仅仅就事论事，通常采用一种被动的态度－“你问我答”。如果外界的情境产生压力或困难，他们可能会希望更多地介入以直接影响，但是他们仍然只是会就事论事，轻易不会涉及到个人或者情感的方面。', '他们喜欢与事实、复杂的程序或系统开展工作，倾向于对工作与生活都采取同样的标准，即追求“效率”与“质量”并重。他们对于自己的个人生活有着明确的目标，这种深思熟虑耐性的特征，通常也帮助他们避免了不必要的风险与冒失的行为。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('17', 'SI', '建议者', 'I,S+,D,C-且S>I', '通常善于关怀，同情和理解他们身边的人。他们在大多数社会情境里总能找到平衡。他们是很好的倾听者，极富人情味的朋友。他们也是天生的团队参与者，在平和的环境里表现通常出色。建议者一般不会将自己的想法强加于人，面对冲突通常回避妥协。他们通常需要获得关注与称赞。', '非常易于被他人接近的；他们友善且具同情心，也通常快乐；这种行为类型的个体以人际关系为导向，婉转幽默。', '可能缺乏自我的激励与约束性；他们可能不具主动性且害怕尝试新的事物，因为他们会因此感受到不安全感。', '很轻易地融入社交的氛围中，他们妥帖适度的行为举止也使得他们很容易与陌生人建立起互动。他们通常深具说服力，但是，其“稳健”的行为因子也预示着如果情境需要，他们也可以采取相对被动开放的姿态，以倾听或尝试接受他人的建议。', '优势在于沟通与理解。“影响”与“稳健”因子相互平衡，以满足这种行为类型个体很好地充当“支持”的角色。同时，其外向的行为特征也意味着他们在需要互动与说服的情境下也能自如因应。需要指出的是，相比较纯粹的“稳健”行为特征来说，他们较少关注实用性，而显得少许“浮”了一点。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('18', 'SIC', '倡导者', 'I,S,C+,D-且S>I>C', '通常是稳定的、社交性的人，不管是在工作中还是在家庭中，都会为积极的人际关系而努力。他们强调细节，一旦下定决心，就很难被改变。他们希望获得互相支持，归属感很强。倡导者一般都很温和，而且值得信赖。他们通常也会是不错的调解者，因为他们通常都是辨证地看待问题，因此，倡导者是人际导向的。', '非常易于被他人接近的；他们友善且具同情心，也通常快乐；这种行为类型的个体以人际关系为导向，婉转幽默。', '可能缺乏自我的激励与约束性；他们可能不具主动性且害怕尝试新的事物，因为他们会因此感受到不安全感。', '三个显著因子都传递着“沟通”的信息。“影响”代表着他们外向友好的态度；“稳健”代表着他们耐心并乐于倾听；而“服从”则代表着他们总是可以理性地看待问题，提出令人信服且合情合理的建议。', '通常能够很好地与他人合作，并关注他人意见的表达。虽然他们同样能够显示出领导者的某些特质，但是“武断”与“固执”却不是他们的显著特征。他们可以显示出其外向乐群的能力特征，但是同样也可以显示出其感性、深具同理心的一面。', '1441693256', '1441693256');
INSERT INTO `review360_report_str_result` VALUES ('19', 'SC', '调解者', 'S,C+,D,I-且S>C', '通常生性和善，关注细节。他们关心别人，并在工作中一丝不苟。他们需要有安全感的稳定环境。调解者一般会仔细地思考问题，会权衡决定对于他人的影响。他们基于数据与事实去影响他人。调解者处理问题需要时间，他们非常敏感，不能很好地应对批评，因此他们通常设法做到最好。他们也经常隐藏自己的情感。', '是天生的“外交家”，态度从容且行为优雅；这种行为类型的个体通常不具攻击性，且很少发怒；他们可被依赖，追求准确与次序。', '有可能是利己主义者；这种行为类型的个体也可能在内心深处看待事物上存在负面的想法，因此显得尖刻；他们也害怕变化与冲突。', '人际的交流沟通方面，其被动的行为模式一般情况下很难与他人进行互动，尤其是在不熟悉的情境下，因为他们需要在明确了解自己的处境后才能行动。在内心，他们非常重视友谊与人情关系，但是却往往被他们冷漠与内敛的表象所掩盖。为了能够更有效地与他人进行沟通，这种类型的个体需要以一种更加直接与开放的态度去发起或控制人际之间的互动。', '通常表现在具有复杂的系统与程序的环境中。他们“稳健”的特征带来了耐性与坚持；而他们“服从”的特征带来了次序与精确。这两种特征的组合反映了个体在技术领域工作的卓越优势。正因为他们对于质量与效率的兴趣与追求，我们通常可以发现他们具有某些特殊的专业技能与才干。', '1441693257', '1441693257');
INSERT INTO `review360_report_str_result` VALUES ('20', 'C', '逻辑思维者', 'C+,D,I,S-', '通常表现出实事求是、合理与独立的特性。他们有很高的自我评价能力，对自己和他人可能都很严格，但一般却很少表达出来，显得平静而沉默。他们最怕被批评，所以会通过不懈努力以达到完美。“逻辑思维者”会反复加工信息、分析问题。有时因此显得对人冷淡，反应迟钝。', '通常是精确的，善于分析的；他们自我责任意识很强，且严肃认真；总是要求实事求是，且严谨精确；对人对己都采取高标准。', '需要明确的活动或人际的界限；他们很容易受到过程或方法的局限，经常会陷入细节的泥沼中；通常不善于表达情感，容易逃避妥协而不是直面问题。', '交流沟通的能力却显得很不足。内敛的性格加上怀疑的天性，使得他们很难去构建并维持一种亲密的人际关系，尤其是在商业的环境中。如果他们能够去建立一种亲密的伙伴关系或朋友关系，也是建立在拥有相同的爱好以及目标的基础上，而通常不是基于情感的考虑。', '通常是一个非常自立自主的人，这种行为类型的个体具有非常结构性的思维模式，对于诸如组织整理信息、处理需要极其细致态度的工作、或者在非常复杂的系统中进行分析判断，他们将显示出独特的优势。', '1441693257', '1441693257');
INSERT INTO `review360_report_str_result` VALUES ('21', 'CD', '设计者', 'D,C+,I,S-且C>D', '通常以任务为导向的，对问题非常敏感。他们善于用创造性的、坚定的、分析的方式来有效解决问题，他们不接受“权宜之计”。他们的目的就是正确地、有控制地做好每一件事，同时避免失败。他们能够激发改变和进步，因为他们擅长管理技巧。设计者常常认为他们是唯一能正确行事的人，所以他们通常不主动寻求帮助。', '是“完美主义者”与“主导者”的结合；这种行为类型的个体追求事实与抱负，他们通常都有所准备，且条理分明、次序井然。', '有可能很难被予以接近；这种行为类型的个体对自己有着极高的要求，在行为或言语上可能体现出尖酸刻薄；他们通常很难释怀，容易被激怒。', '通常不将人际的交流沟通（至少是在人与人这个层面上）作为他们待人处事的重要因素被加以考虑。如果与人的交流沟通是非常重要的，他们倾向于简短、直接且实际。他们通常以怀疑的态度审视事与物，除非绝对必要，他们轻易不会表达自己的观点或见解。', '总是被成就与效率所激励。因为“服从”因子（C）的存在，他们又非常关注细节与精确性。比如，他们会观察并指出他人的错误或疏漏，有时候却会显得过于吹毛求疵。但是，这种“效率”与“精确”的组合，再加上一点强硬的态度，却可以在面对困难任务时，显得非常有效。', '1441693257', '1441693257');
INSERT INTO `review360_report_str_result` VALUES ('22', 'CDS', '思考者', 'D,S,C+,I-且C>D>S', '通常关注于任务的完成与质量。他们善于分析与逻辑思考，关注细节并对自己及他人有很高的要求。思考者对执行的任务全神贯注，沉着而值得被信赖。他们细致准确，决策前倾向于反复评估与思考。一旦决策被予以执行，思考者通常也是效率与质量的保证。', '是“完美主义者”与“主导者”的结合；这种行为类型的个体追求事实与抱负，他们通常都有所准备，且条理分明、次序井然。', '有可能很难被予以接近；这种行为类型的个体对自己有着极高的要求，在行为或言语上可能体现出尖酸刻薄；他们通常很难释怀，容易被激怒。', '他们可能仅仅就事论事，通常采用一种被动的态度－“你问我答”。如果外界的情境产生压力或困难，他们可能会希望更多地介入以直接影响，但是他们仍然只是会就事论事，轻易不会涉及到个人或者情感的方面。', '他们喜欢与事实、复杂的程序或系统开展工作，倾向于对工作与生活都采取同样的标准，即追求“效率”与“质量”并重。他们对于自己的个人生活有着明确的目标，这种深思熟虑耐性的特征，通常也帮助他们避免了不必要的风险与冒失的行为。', '1441693257', '1441693257');
INSERT INTO `review360_report_str_result` VALUES ('23', 'CI', '评估者', 'I,C+,D,S-且C>I', '通常善于观察细节，包括人的独特价值。他们会利用特定的关注去观察和鉴赏他人的工作，以促使公开交流渠道的形成。他们对所要完成的任务总是表现出极大的热爱与乐观，而且也影响了周围的人。他们对于事物的热爱总是基于对目标达成的因素评价上的，他们的鼓励直接指向任务的完成。他们喜欢评价，也关注细节。', '以客观事实为导向且注重人际关系；这种行为类型的个体通常压力感较低，不愿意冒险，他们是天生的教书育人的“良师”。', '情绪情感丰富，起伏较大，且有时自怜自哀；这种行为类型的个体可能过度解读某些事物而显得有点苛刻；同时，他们有可能自我意识很弱。', '在朋友的圈子内，或非正式的场合，其行为模式通常显示出自信与外向的表现；在正式的工作、商业场合，或者在压力的气氛下（例如面试、谈判），其自信外向的一面可能会被一种更加内敛谨慎的态度所取代。', '不同的情境会产生不同的行为反映，因此，对于管理者来说，如果需要有效地管理该个体或预测其绩效，需要仔细考虑其所处环境对其的影响。通常情况下，这种行为类型的个体将更多地显示出其“影响”的一面，因此，自信与善于交流的能力特征一般也较为明显。', '1441693257', '1441693257');
INSERT INTO `review360_report_str_result` VALUES ('24', 'CIS', '折中者', 'I,S,C+,D-且C>I>S', '通常是典型的人际关系取向者，强调正确与忠诚。折中者的主要目标就是和团队共同去完成目标，同时保持稳定和谐的环境。他们友好，热情、随意、健谈，会过多在意他人的想法。他们对批评非常敏感，因为他们很在意自己的工作质量。通常，他们愿意竭尽所能去创建或维持良好的工作氛围。', '以客观事实为导向且注重人际关系；这种行为类型的个体通常压力感较低，不愿意冒险，他们是天生的教书育人的“良师”。', '情绪情感丰富，起伏较大，且有时自怜自哀；这种行为类型的个体可能过度解读某些事物而显得有点苛刻；同时，他们有可能自我意识很弱。', '三个显著因子都传递着“沟通”的信息。“影响”代表着他们外向友好的态度；“稳健”代表着他们耐心并乐于倾听；而“服从”则代表着他们总是可以理性地看待问题，提出令人信服且合情合理的建议。', '通常能够很好地与他人合作，并关注他人意见的表达。虽然他们同样能够显示出领导者的某些特质，但是“武断”与“固执”却不是他们的显著特征。他们可以显示出其外向乐群的能力特征，但是同样也可以显示出其感性、深具同理心的一面。', '1441693257', '1441693257');
INSERT INTO `review360_report_str_result` VALUES ('25', 'CS', '完美主义者', 'S,C+,D,I-且C>S', '通常强调精确性，注重细节并沉稳坚定。他们善于系统思考，无论是在生活中还是工作中，都倾向于按部就班，遵守既定的流程。他们行事老练，会很小心地规避冲突，所以很少有意引发矛盾。他们也非常有责任心，工作中一丝不苟，有着极高的标准，可被信赖。', '是天生的学者，次序井然且条理清楚；这种行为类型的个体通常善于分析，自我意识强；他们专心细致，追求精准。', '易于感受到挫折与气馁；在压力下，通常带有负面的或“灾难化”的想法，有可能时常经历内心的挣扎；他们虽然有着固执的一面却不愿直面表达。', '在人际的交流沟通方面，其被动的行为模式一般情况下很难与他人进行互动，尤其是在不熟悉的情境下，因为他们需要在明确了解自己的处境后才能行动。在内心，他们非常重视友谊与人情关系，但是却往往被他们冷漠与内敛的表象所掩盖。为了能够更有效地与他人进行沟通，这种类型的个体需要以一种更加直接与开放的态度去发起或控制人际之间的互动。', '能力特征通常表现在具有复杂的系统与程序的环境中。他们“稳健”的特征带来了耐性与坚持；而他们“服从”的特征带来了次序与精确。这两种特征的组合反映了个体在技术领域工作的卓越优势。正因为他们对于质量与效率的兴趣与追求，我们通常可以发现他们具有某些特殊的专业技能与才干。', '1441693257', '1441693257');
